import Button from "../UI/Button";
import Card from "../UI/Card";
import "./AddUser.css"
const AddUser = () => {

    const addUserHandler = (event) => {
        event.preventDefault();
        console.log(event)
    }

    return(
        <div classname="antialiased text-gray-900 px-6">
        <div className="mt-8 max-w-md">    
        <Card>
            <form className="input flex flex-col space-y-4 items-start " onSubmit={addUserHandler}>
                <label htmlFor="userName" className="text-gray-700">User name: </label>
                <input type="text" name="userName" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50 h-10 px-2"></input>
                <label htmlFor="age" className="text-gray-700">Age: </label>
                <input type="number" name="age" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50 h-10 px-2"></input>
                <Button type="submit">Submit</Button>
            </form>
        </Card>
        </div>

        </div>

    )
}

export default AddUser;
